import React from 'react';
import './App.css';
import { Outlet } from 'react-router-dom';

function Home() {
  return (
    <div className="div">
      <Outlet />
      <h1 className="text-capitalize h1 mb-4 w-100 text-center">
        Welcome to Joel Hilton's Movie Collection
      </h1>
      <div>
        <img
          src="./joel.jpg"
          alt="Joel"
          className="position-relative img-fluid"
        ></img>
      </div>
    </div>
  );
}

export default Home;
